import { Routes, Route } from "react-router-dom"
import ListUsers from "../components/ListUsers"


const PrivateRoutes = (props) => {


    return (
        <>
            <Routes>
                <Route path={props.path} element={props.children}/>
            </Routes>
        </>
    )
}

export default PrivateRoutes
